import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import './App.css';
import Header from './navbar';
import Movies from './movie';

class App extends Component {
  render() {

      return (
            <div className="App">
             <Header/>
             <Movies/>
            </div>
        );
    }
}


export default App;
